<div class="box-body">
    <p style="text-align:justify;text-indent:40px;">Fitur Search Data CSI dapat diakses oleh user Administrator dan Operator yang dimana memiliki fungsi untuk melihat Data yang telah berhasil disinkronisasikan.</p>
    <ol style="text-align:justify;">
        <li>Pada halaman home page silahkan pilih “Data CSI”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Pada saat fitur Data CSI sudah dipilih maka akan menampilkan semua  Data CSI.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search  Data CSI berdasarkan “CSI”, pengguna dapat input Nomor CSI kemudian Enter, maka akan menampilkan spesifik Nomor CSI.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search  Data CSI berdasarkan “Serial Number”, pengguna dapat input Serial Number kemudian Enter, maka akan menampilkan spesifik Serial Number.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search  Data CSI berdasarkan “Product Number”, pengguna dapat input Product Number kemudian Enter, maka akan menampilkan spesifik Product Number.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Data CSI berdasarkan “Model”, maka akan menampilkan spesifik Model.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Data CSI berdasarkan “App Version”, maka akan menampilkan spesifik App Version.</li>
